import React from "react";

const About = () => {
  return (
    <div className="container mt-4">
      <h2>About Us</h2>
      <p>
        Welcome to our website! We are a team of data enthusiasts who love to explore alternative ways of visualizing data. This website showcases various creative and innovative data visualizations that can help you gain unique insights from your data. Take a tour and enjoy the art of data visualization!
      </p>
    </div>
  );
};

export default About;
